import React from 'react';
import { Link } from 'react-router-dom';
import logo from './ProteoInsight.png'

function NavBar(){
  const navStyle = {
    backgroundColor: '#6EA8DD',
    display: 'flex',
    alignItems: 'center',
    padding: '0 20px', // 增加左右内边距
  };

  const logoStyle = {
    display: 'block',
    height: '40px',
    marginRight: '20px', // 设置右侧距离
    cursor: 'pointer',
  };
  return(
    <div style={{backgroundColor: '#6EA8DD', height: '100px', width: '100vw'}}>
      <Link to="/">
        <img src={logo} alt="Logo" style={{logoStyle}} />
      </Link>		
    </div>
  )
};

export default NavBar;
